import React, { Component }  from 'react';
import { PageHeader, Affix, Button, Card, Carousel } from 'antd';
import './index.less';

const contentStyle = {
  height: '160px',
  color: '#fff',
  lineHeight: '160px',
  textAlign: 'center',
  background: '#364d79',
};

class HomePage extends Component {
  constructor(props) {
    super(props);
    this.state = {
      isLogin: true,
      isDev: false
    }
  }

  render() {
    const { isLogin, isDev } = this.state;

    return (   
      <div className="home-page">
        <PageHeader
          className="home-page-header"
          backIcon={false}
          title="FA监控平台"
          subTitle="Flight Aware Monitoring Platform"
        />
        <Affix style={{width: '75%'}} offsetTop={30}>
          <div className="home-page-affix">
            <Button style={{marginTop: 10,   marginLeft: 20, marginRight: 20 }} type="primary">
              快速开始
            </Button>
            {
              isLogin && <Button style={{marginTop: 10,   marginLeft: 20, marginRight: 20}} type="primary">
                新建项目
              </Button>
            }
            {
              isLogin && <Button style={{marginTop: 10,   marginLeft: 20, marginRight: 20}} type="primary">
                我的项目
              </Button>
            }
            {
              !isLogin && <Button style={{marginTop: 10,   marginLeft: 20, marginRight: 20}} type="primary">
                用户登陆
              </Button>
            }
            {
              !isLogin && <Button style={{marginTop: 10,   marginLeft: 20, marginRight: 20}} type="primary">
              注册账号
            </Button>
            }
            {
              isDev && <Button style={{marginTop: 10,   marginLeft: 20, marginRight: 20}} type="primary">
              内测调试
            </Button>
            }
          </div>
        </Affix>
        <div className="home-page-carousel">
          <Carousel autoplay={true}>
            <div>
              <h3 style={contentStyle}>1</h3>
            </div>
            <div>
              <h3 style={contentStyle}>2</h3>
            </div>
            <div>
              <h3 style={contentStyle}>3</h3>
            </div>
            <div>
              <h3 style={contentStyle}>4</h3>
            </div>
          </Carousel>
        </div>
        <Card
          hoverable
          style={{ width: '75%', marginTop: 20, height: 2000 }}
        >
        </Card>
      </div>
    );
  }
}

export default HomePage;
